import './App.css';

function App() {
  return (
    <div>
      <header className="bg-orange-700 p-4">
        <h1 className="text-white text-xl font-bold">Calculadora</h1>
      </header>
      <p>Esto es una Calculadora</p>
    </div>
  );
}

export default App;
